By Council Members Salamanca, Jr. and Moya

      WHEREAS, 48-18 Property Holdings, LLC, filed an application pursuant to Sections 197-c and 201 of the New York City Charter for an amendment of the Zoning Map, Section No. 9b, changing from an M2-1 District to an M1-5 District, property in the Long Island City neighborhood of Queens, Community District 2 (ULURP No. C 190260 ZMQ) (the "Application");

      WHEREAS the City Planning Commission filed with the Council on September 10, 2021, its decision dated August 18, 2021 (the "Decision") on the Application;

      WHEREAS, the Decision is subject to review and action by the Council pursuant to Section 197-d of the City Charter;

      WHEREAS, upon due notice, the Council held a public hearing on the Decision and Application on September 24, 2021;

      WHEREAS, the Council has considered the land use and other policy issues relating to the Decision and Application; and

      WHEREAS, the Council has considered the relevant environmental issues, including the Conditional Negative Declaration (CND) issued August 18, 2021, (CEQR No. 20DCP096Q). As described in the CND, the applicant will enter into a Restrictive Declaration to ensure implementation of measures relating to transportation and open space. Additionally, the CND includes an (E) designation to avoid the potential for significant adverse impacts related to noise, air quality, and hazardous materials (the "E" Designation (E-608));

RESOLVED:

      The Council finds that the action described herein will have no significant impact on the environment as set forth in the (E) Designation (E-608) and Conditional Negative Declaration.

      Pursuant to Sections 197-d and 200 of the City Charter and on the basis of the Decision and Application, and based on the environmental determination and consideration described in the report, C 190260 ZMQ, incorporated by reference herein, and the record before the Council, the Council approves the Decision of the City Planning Commission.

The Zoning Resolution of the City of New York, effective as of December 15, 1961, and as subsequently amended, is further amended by changing the Zoning Map, Section No. 9b to change from an M2-1 District to an M1-5 District property bounded by 48th Avenue, Van Dam Street, Hunters Point Avenue, and 31st Place; as shown on a diagram (for illustrative purposes only) dated April 5, 2021, and subject to the conditions of CEQR Declaration E-608, Community District 2, Borough of Queens.


Adopted.

